import React from 'react'
import styled from 'styled-components'
import Lottie from 'react';
import * as animationData from '../assets/LottieJson/cover.json'
// import CoverVideoScript from '../CoverVideoScript/CoverVideoScript'
// import LottieScript from '../lottieScript/LottieScript'
// import lottie from '../lottieScripts/lottieScript'
// import lottie from '../lottieScripts/lottie'
const defaultOptions = {
    loop: true,
    autoplay: true,
    animationData: animationData,
    rendererSettings: {
    preserveAspectRatio: "xMidYMid slice"
    }
};

const VideoContainer = styled.div`
width: 100%;
`
const CoverVideo = () => {
  return (
    
    <VideoContainer>
        <Lottie 
	    options={defaultOptions}
        // height={400}
        // width={400}
      />
    </VideoContainer>
   
  )
}

export default CoverVideo
